With the holidays over now so much of my mental bandwidth is dedicated to looking towards the coming year. I have a lot of hopes for 2024, some residual unresolved hopes of the year past. Others that are a bit more fresh. But my greatest desire is that the whole of my hopes and desires would not be defined by selfish ambition or vain pursuits. These last couple years have been a time of reorientation for me and my family. Things that I once valued greatly have become less significant, and in some cases even insignificant. So, my hope for 2024 is to live, as much as I am able, according to the sentiment that Jesus uttered to His Father as He prepared to face the greatest and most difficult moment of His human existence- “..not my will, but Yours be done.” 

What are your hopes for 2024? 

